import (
	context "context"
	rapiddocs "github.com/examples-minimal/rapiddocs"
	rapiddocsclient "github.com/examples-minimal/rapiddocs/client"
	option "github.com/examples-minimal/rapiddocs/option"
)

client := rapiddocsclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
	option.WithBaseURL(
		rapiddocs.Environments.Production,
	),
)
response, err := client.Service.CreateBigEntity(
	context.TODO(),
	rapiddocs.NewTestFromAnd(
		true,
	),
)

